package com.kuangchi.sdd.consumeConsole.vendor.model;

public class Vendor {
	private String id;
	private String vendor_num;//商户编号
	private String vendor_name;//商户名称
	private String address;//商户地址
	private String vendor_type_num;//商户类型编码
	private String vendor_dealer_name;//商家名称
	private String vendor_dealer_id_card;//商家身份证号码
	private String vendor_phone;//电话号码
	private String register_date;//注册时间
	private String register_bail;//注册押金
	private String contract_start_date;//合约开始时间
	private String contract_end_date;//合约结束时间
	private String previous_time;//上次清算时间
	private String remark;//备注
	private String delete_flag;//删除标志位
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getVendor_num() {
		return vendor_num;
	}
	public void setVendor_num(String vendor_num) {
		this.vendor_num = vendor_num;
	}
	public String getVendor_name() {
		return vendor_name;
	}
	public void setVendor_name(String vendor_name) {
		this.vendor_name = vendor_name;
	}
	public String getAddress() {
		return address;
	}
	public void setAddress(String address) {
		this.address = address;
	}
	public String getVendor_type_num() {
		return vendor_type_num;
	}
	public void setVendor_type_num(String vendor_type_num) {
		this.vendor_type_num = vendor_type_num;
	}
	public String getVendor_dealer_name() {
		return vendor_dealer_name;
	}
	public void setVendor_dealer_name(String vendor_dealer_name) {
		this.vendor_dealer_name = vendor_dealer_name;
	}
	public String getVendor_dealer_id_card() {
		return vendor_dealer_id_card;
	}
	public void setVendor_dealer_id_card(String vendor_dealer_id_card) {
		this.vendor_dealer_id_card = vendor_dealer_id_card;
	}
	public String getVendor_phone() {
		return vendor_phone;
	}
	public void setVendor_phone(String vendor_phone) {
		this.vendor_phone = vendor_phone;
	}
	public String getRegister_date() {
		return register_date;
	}
	public void setRegister_date(String register_date) {
		this.register_date = register_date;
	}
	public String getRegister_bail() {
		return register_bail;
	}
	public void setRegister_bail(String register_bail) {
		this.register_bail = register_bail;
	}
	public String getContract_start_date() {
		return contract_start_date;
	}
	public void setContract_start_date(String contract_start_date) {
		this.contract_start_date = contract_start_date;
	}
	public String getContract_end_date() {
		return contract_end_date;
	}
	public void setContract_end_date(String contract_end_date) {
		this.contract_end_date = contract_end_date;
	}
	public String getPrevious_time() {
		return previous_time;
	}
	public void setPrevious_time(String previous_time) {
		this.previous_time = previous_time;
	}
	public String getRemark() {
		return remark;
	}
	public void setRemark(String remark) {
		this.remark = remark;
	}
	public String getDelete_flag() {
		return delete_flag;
	}
	public void setDelete_flag(String delete_flag) {
		this.delete_flag = delete_flag;
	}
	
	
}
